import { useEffect,useState } from "react";
import "./index.css"

function App(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("http://localhost:3007/Student")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.groupCollapsed(resp)
            setData(resp)
        })
    })
    return(
        <div>
            <h3>Fetch Data From Back End</h3>
            <table>
                <thead>
                    <tr>
                        <th>Student Id</th>
                        <th>Class</th>
                        <th>Name</th>
                        <th>City</th>
                        <th>Mobile</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item)=>(

                   
                    <tr>
                        <td>{item.id}</td>
                        <td>{item.class}</td>
                        <td>{item.name}</td>
                        <td>{item.city}</td>
                        <td>{item.mobile}</td>
                    </tr>
                     ))}
                </tbody>
            </table>
        </div>
    )
}
export default App;
